import React from 'react';

const Workout = () => {
  return (
    <div className="workout">
      <h2 className="workout-title">Full Body Workout</h2>
      <p className="workout-description">
        This full body workout targets all major muscle groups and helps improve strength and endurance.
      </p>
      <div className="workout-exercises">
        <h3 className="workout-exercises-title">Exercises</h3>
        <ul className="exercise-list">
          <li className="exercise-item">Exercise 1</li>
          <li className="exercise-item">Exercise 2</li>
          <li className="exercise-item">Exercise 3</li>
          {/* Add more exercises here */}
        </ul>
      </div>
      <div className="workout-duration">
        <h3 className="workout-duration-title">Duration</h3>
        <p className="workout-duration-value">45 minutes</p>
      </div>
      <div className="workout-intensity">
        <h3 className="workout-intensity-title">Intensity</h3>
        <p className="workout-intensity-value">Intermediate</p>
      </div>
      {/* Add more details about the workout (e.g., equipment needed, target muscles, etc.) */}
    </div>
  );
};

export default Workout;
